import React from "react";
import './NavBar.css'

const NavBar = () => {
    return(
        <div className="navbar navbar-light bg-light">
            <a className="Links navbar-brand" href="#">.HOME()</a>
            <a className="Links navbar-brand" href="#">.ABOUT()</a>
            <a className="Links navbar-brand" href="#">.SKILLS()</a>
            <a className="Links navbar-brand" href="#">.CONTACT()</a>
        </div>
    );
}
export default NavBar;
